var textsize = 15
var structure
var firstStructure

ModPE.setItem(structureSelectorId,"dye_powder",10,"Structure Selector")
ModPE.setItem(structureBuilderId,"dye_powder",9,"Structure Builder")
Player.addItemCreativeInv(structureSelectorId,1,0)
Player.addItemCreativeInv(structureBuilderId,1,0)

function newLevel(){
 var out=new java.io.ByteArrayOutputStream();
	var response=android.net.http.AndroidHttpClient.newInstance("Online()").execute(new org.apache.http.client.methods.HttpGet("https://raw.githubusercontent.com/wilco375/Minecraft-PE-Mod-Scripts/master/ISM_update_checker.txt")).getEntity().writeTo(out);
	out.close();
	clientMessage(String(out.toString()))
}

function useItem(x,y,z,itemId,blockId,side){
	if(itemId == structureSelectorId){
		showSelectionGUI()
	}
	if(itemId == structureBuilderId){
		if(firstStructure == null){
			var X=[x]
			var X2=[]
			var Y=[y]
			var Y2=[]
			var Z=[z]
			var Z2=[]
			var I=[getTile(x,y,z)]
			var D=[Level.getData(x,y,z)]
			for(n=0;n<1+1;n++){
				setTile(X[n], Y[n], Z[n], 2);
			}
			setTile(X2[0],Y2[0],Z2[0],I[0],D[0])
			firstStructure = 1
		}
		if(structure == null){
			clientMessage("Please select a structure using the Structure Selector")
		}
		else if(structure == 1){
			smallRewardTreeGUI(x,y,z)
		}
		else if(structure == 2){
			treeHouseGUI(x,y,z)
		}
		else if(structure == 3){
			parkGUI(x,y,z)
		}
		else if(structure == 4){
			cobbleGenGUI(x,y,z)
		}
		else if(structure == 5){
			smallHouseGUI(x,y,z)
		}
		else if(structure == 6){
			mansionGUI(x,y,z)
		}
		else if(structure == 7){
			houseGUI(x,y,z)
		}
		else if(structure == 8){
			bigRewardTreeGUI(x,y,z)
		}
		else if(structure == 9){
			poorMensHouseGUI(x,y,z)
		}
		else if(structure == 10){
			volcanoGUI(x,y,z)
		}
		else if(structure == 11){
			ruinsGUI(x,y,z)
		}
	}
}

